import React, { useState } from 'react'; 

function Login() { 
  function LoginHandler() { 
    console.log('clicked'); 
  }

  return (
      <form>
        <div className="login-style">
          <input type="email"/>
          <input type="password"/>
          <button type="submit" onClick={LoginHandler}>Login</button>
        </div>

      </form>
    ); 
}

export default Login;
